import React, { useState } from 'react';

// Dummy data for companies (replace with your actual data fetching)
const companiesData = [
  {
    id: 1,
    name: 'Tech Innovations Inc.',
    category: 'Technology',
    size: 'Large',
    location: 'San Francisco, CA',
    employees: 500,
    description: 'Leading tech company specializing in AI.',
    logo: 'https://via.placeholder.com/150', // Replace with actual logo URLs
    website: 'https://techinnovations.com',
  },
  {
    id: 2,
    name: 'Foodie Delights Ltd.',
    category: 'Food & Beverage',
    size: 'Medium',
    location: 'New York, NY',
    employees: 150,
    description: 'Delicious food and catering services.',
    logo: 'https://via.placeholder.com/150',
    website: 'https://foodiedelights.com',
  },
  {
    id: 3,
    name: 'Green Solutions Co.',
    category: 'Environmental',
    size: 'Small',
    location: 'London, UK',
    employees: 50,
    description: 'Sustainable environmental solutions.',
    logo: 'https://via.placeholder.com/150',
    website: 'https://greensolutions.co.uk',
  },
    // ... more companies
];

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [filterCategory, setFilterCategory] = useState('');
  const [filterSize, setFilterSize] = useState('');
  const [filterLocation, setFilterLocation] = useState('');
  const [selectedCompany, setSelectedCompany] = useState(null);

  const handleSearch = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleCategoryFilter = (event) => {
    setFilterCategory(event.target.value);
  };

    const handleSizeFilter = (event) => {
    setFilterSize(event.target.value);
  };

    const handleLocationFilter = (event) => {
    setFilterLocation(event.target.value);
  };

  const filteredCompanies = companiesData.filter((company) => {
    const nameMatch = company.name.toLowerCase().includes(searchTerm.toLowerCase());
    const categoryMatch = filterCategory ? company.category === filterCategory : true;
    const sizeMatch = filterSize ? company.size === filterSize : true;
    const locationMatch = filterLocation ? company.location === filterLocation : true;
    return nameMatch && categoryMatch && sizeMatch && locationMatch;
  });

  const handleCompanyClick = (company) => {
    setSelectedCompany(company);
  };

  const handleBack = () => {
    setSelectedCompany(null);
  };

  if (selectedCompany) {
    return (
      <div style={{ padding: '20px' }}>
        <button onClick={handleBack}>Back to Directory</button>
        <h2>{selectedCompany.name}</h2>
        <img src={selectedCompany.logo} alt={`${selectedCompany.name} Logo`} style={{ maxWidth: '200px' }} />
        <p><strong>Category:</strong> {selectedCompany.category}</p>
        <p><strong>Size:</strong> {selectedCompany.size}</p>
        <p><strong>Location:</strong> {selectedCompany.location}</p>
        <p><strong>Employees:</strong> {selectedCompany.employees}</p>
        <p><strong>Description:</strong> {selectedCompany.description}</p>
        <a href={selectedCompany.website} target="_blank" rel="noopener noreferrer">
          Visit Website
        </a>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px' }}>
      <h1>Company Directory</h1>

      {/* Search and Filters */}
      <input
        type="text"
        placeholder="Search companies..."
        value={searchTerm}
        onChange={handleSearch}
        style={{ marginBottom: '10px' }}
      />
      <select value={filterCategory} onChange={handleCategoryFilter}>
        <option value="">All Categories</option>
        <option value="Technology">Technology</option>
        <option value="Food & Beverage">Food & Beverage</option>
        <option value="Environmental">Environmental</option>
        {/* Add more categories */}
      </select>
        <select value={filterSize} onChange={handleSizeFilter}>
        <option value="">All Sizes</option>
        <option value="Small">Small</option>
        <option value="Medium">Medium</option>
        <option value="Large">Large</option>
      </select>
        <select value={filterLocation} onChange={handleLocationFilter}>
        <option value="">All Locations</option>
        <option value="San Francisco, CA">San Francisco, CA</option>
        <option value="New York, NY">New York, NY</option>
        <option value="London, UK">London, UK</option>
      </select>

      {/* Featured Companies/Search Results */}
      <div>
        {filteredCompanies.map((company) => (
          <div
            key={company.id}
            style={{ border: '1px solid #ccc', padding: '10px', margin: '5px', cursor: 'pointer' }}
            onClick={() => handleCompanyClick(company)}
          >
            <h3>{company.name}</h3>
            <p>Category: {company.category}</p>
            <p>Location: {company.location}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
